function test01IsMorph(aPart) {
    this.assert(aPart.isMorph, 'rectangle should be a morph');
}

1002.source:
function reset() {
    this.constraints.invoke("disable");
    this.ensureMorphs();
    this.submorphs.each(function (ea, idx) {
        if (idx === 0) return;
        var other = this.submorphs[idx - 1],
            dist = ea.getBounds().realWidth() * 1.5,
            that = this;

        this.constraints.push((function () {
                return ea.getPosition().dist(other.getPosition()) < dist;
            }).shouldBeSatisfiedWith(function () {
                ea.getPosition().formula([other.getPosition()], function (pos, out) {
                    return that.moveAlongLine(pos, out, dist, ea);
                });
                other.getPosition().formula([ea.getPosition()], function (pos, out) {
                    return that.moveAlongLine(pos, out, dist, other);
                });
            }, {ea: ea, other: other, dist: dist, that: that})
        );
    }.bind(this));
}

1005.source:
function ensureMorphs() {
    if (this.submorphs.length === 0) {
        for (var i = 0; i < 15; i++) {
            this.addMorph(lively.morphic.Morph.makeRectangle(i * 15, i * 15, 30, 30));
        }
    }
    this.submorphs[0].setPosition(pt(0, 0));
}

1008.source:
function moveAlongLine(pos, out, dist, morph) {
    var newPt = pos.lineTo(out).sample(dist)[1];
    morph.setPosition(newPt);
    return newPt;
}
